import React, { useEffect } from 'react';
import axios from 'axios';

function Table() {

    useEffect(() => {
        axios.get('/get-users').then((response) => {
            console.log(response)
        })
    })
    return (
        <div>
            <table>
  <tr>
    <th>Id</th>
    <th>name</th>
    <th>email</th>
  </tr>
  <tr>
    <td>1</td>
    <td>Smith</td>
    <td>@gmail.com</td>
  </tr>
  <tr>
    <td>1</td>
    <td>Jackson</td>
    <td>@gmail.com</td>
  </tr>
</table>
        </div>
    )
}

export default Table
